import { Component } from "react";
import Link from 'next/link';


// const index = ()=> {
    
//     return(

//         <h1>I am Index page</h1>
//     );
    
// }

//Class component
//More functionality
//More stuff
//User lifecycle function
class index extends React.Component {
    
    render(){
        return(
            <div>
                <h1>I am Index page</h1>
                <Link href="/">
                <a>Home</a>
                </Link>

                <Link href="/about">
                <a>About</a>
                </Link>

                <Link href="/portfolios">
                <a>Portfolio</a>
                </Link>

                <Link href="/blogs">
                <a>Blog</a>
                </Link>

                <Link href="/cv">
                <a>CV</a>
                </Link>
            </div>
        )
    }
}

export default index;
